import {Props} from './Props';
import cn from 'classnames';
import styles from './PartItem.module.css'
import { Link } from 'react-router-dom';
import Button from '../Button/Button';
import LinkTag from '../LinkTag/LinkTag';

export default function PartItem({className, part} : Props) : JSX.Element {


   

  let features = !!part.features ? Object.entries(part.features).map((feature, idx) => (
   <div key={idx}>{feature[0]+' : '+feature[1]}</div>
  )) : <div>None</div>;




  return (
            <article className={cn(className, styles.part)}>
                <section className={styles.partTable}>
                     <img className={styles.partImg} src= {part.img} alt=''/>
                     <section className={styles.middle}>
                           <div className={styles.specName}>{part.name}</div>
                           <div className={styles.features}>{features}</div>
                     </section>
                     <section  className={styles.right}>
                        <div className={styles.partPrice}>{part.price}</div>
                        <div className={styles.partNav}>
                              <Button className={styles.btnAdd}>Добавить</Button>
                              <LinkTag path={part.link} className={styles.partLink}>Ссылка</LinkTag>
                        </div>
                     </section>
                </section>
            </article>
  )
}
